import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Adminresister from "./Adminresister";
import Adminlogin from "./Adminlogin";
import Customerresister from "./Customerresister";
import Customerlogin from "./Customerlogin";
import { Box, Container, Typography } from "@mui/material";

export default function App() {
  return (
    <Router>
      <Box
        sx={{
          minHeight: "100vh",
          backgroundColor: "rgba(35, 55, 198, 0.4)", // Glass effect blue
          backdropFilter: "blur(10px)", // Glass blur effect
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        <Container maxWidth="md">
          {/* Navigation links */}
          <Box component="nav" sx={{ textAlign: "center", mb: 4 }}>
            <Typography variant="h4" sx={{ mb: 2, color: "#ffffff" }}>
              Navigation Links
            </Typography>
            <ul style={{ listStyle: "none", padding: 0 }}>
              <li style={{ margin: "10px 0" }}>
                <Link to="/Adminresister" style={linkStyle}>Go to Admin Register</Link>
              </li>
              <li style={{ margin: "10px 0" }}>
                <Link to="/Adminlogin" style={linkStyle}>Go to Admin Login</Link>
              </li>
              <li style={{ margin: "10px 0" }}>
                <Link to="/Customerresister" style={linkStyle}>Go to Customer Register</Link>
              </li>
              <li style={{ margin: "10px 0" }}>
                <Link to="/Customerlogin" style={linkStyle}>Go to Customer Login</Link>
              </li>
            </ul>
          </Box>

          {/* Routes */}
          <Routes>
            <Route path="/Adminresister" element={<Adminresister />} />
            <Route path="/Adminlogin" element={<Adminlogin />} />
            <Route path="/Customerresister" element={<Customerresister />} />
            <Route path="/Customerlogin" element={<Customerlogin />} />
            <Route path="/" element={<Adminresister />} /> {/* Default route */}
          </Routes>
        </Container>
      </Box>
    </Router>
  );
}

const linkStyle = {
  textDecoration: "none",
  color: "0,0,225",
  fontSize: "18px",
  background: "rgba(255, 255, 255, 0.2)",
  padding: "10px 15px",
  borderRadius: "8px",
  transition: "background 0.3s ease",
};
